import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components
import Nav from '../src/components/dashboard/Nav';
import Jumbo from "../src/components/dashboard/Jumbo";
import Footer from '../src/components/dashboard/Footer';

const cookies = new Cookies();

const home = () => {
    return (
        <Layout>
            <div className='main'>
                <Nav />
                <Jumbo />
                <div className='cards'>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                </div>
                <Footer/>
            </div>
            <style global jsx>{`
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                *{
                    box-sizing: border-box;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }   

                .cards{
                    height: 30%;
                    margin: 20px;
                    justify-content: center;
                    align-items: center;
                    display: flex;
                    flex-direction: row;
                    margin-bottom: 220px;
                }

                .cards .card{
                    width: 25%;
                    height: 80%;
                    margin: 10px;
                    border: 1px solid;
                }

                @media (max-width: 800px){
                    .cards{
                        border: 1px solid;
                        height: 50%;
                        flex-direction: column; 
                    }
                    .cards .card{
                        width: 60%;
                        height: 900%;
                    }
                }

                @media (max-width: 600px){
                    .cards{
                        height: 100%;
                        flex-direction: column;
                    }
                    .cards .card{
                        width: 70%;
                    }   
                }

                @media (max-width: 400px){
                    .cards{
                        height: 100%;
                        flex-direction: column;
                    }
                    .cards .card{
                        width: 90%;
                    }   
                }
            `}</style>
        </Layout>
    );
}

export default home;
